import { Cpu, Code } from "lucide-react";
import SubjectPage from "./SubjectPage";

const OperatingSystem = () => {
  const topics = [
    { name: "Processes & Threads", desc: "Learn process lifecycle, scheduling, and threads.", icon: <Cpu className="w-10 h-10 text-blue-600"/>, path: "/placement-prep/core-subjects/os/processes", color: "from-blue-100 to-blue-50" },
    { name: "Memory Management", desc: "Understand paging, segmentation, and virtual memory.", icon: <Code className="w-10 h-10 text-purple-600"/>, path: "/placement-prep/core-subjects/os/memory", color: "from-purple-100 to-purple-50" },
  ];

  return (
    <SubjectPage
      title="Operating System Preparation"
      description="Learn OS concepts: scheduling, memory management, and synchronization."
      topics={topics}
    />
  );
};

export default OperatingSystem;
